import React from 'react';
import { Container } from 'react-bootstrap';
import Intern from './Intern.jsx'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Internships() {
    return (
        <div>
            <center>
                <h2 className="exp-headings">INTERNSHIPS & CLUBS</h2> 
            </center>
            <Container className="align-middle">
                <Row>
                    <Col lg='12'><Intern name="Marina Bay Sands | Las Vegas Sands Corporation" date="July 2022 - December 2022"/></Col>
                </Row>

                <Row>
                    <Col><Intern name="RSM" date="December 2021 - May 2022"/></Col>
                </Row>

                <Row>
                    <Col><Intern name="RSM" date="December 2021 - May 2022"/></Col>
                </Row>

                <Row>
                    <Col><Intern name="RSM" date="December 2021 - May 2022"/></Col>
                </Row>
            </Container>   
        </div>
    )
}

export default Internships;
